import React from 'react';

const Rank = ({ name, entries }) => {

    return (
        <div>
            <div className='white f3'>
                {`${name} your current entry is ... `}
            </div>
            <div className='white f1'>
                {`{entries.map(entry => ${entry} )}`}
            </div>
        </div>
    );
}

export default Rank;
